import { Fragment } from "react";
import { useRouter } from "next/router";
import posts from "../../api/posts.json";

export default () => {
	const router = useRouter();
	const post = posts[router.query.id];
	return (
		<Fragment>
			<p>Hi {post.content}</p>
		</Fragment>
	);
};
